(64, 53, '<p><em><strong>C&ocirc;ng ty TNHH Tư Vấn Quản L&yacute; Lương được th&agrave;nh lập, theo Giấy chứng nhận đăng k&yacute; kinh doanh số 4102039469 do Sở Kế Hoạch v&agrave; Đầu Tư Th&agrave;nh Phố Hồ Ch&iacute; Minh cấp ng&agrave;y 17 th&aacute;ng 5 năm 2006.</strong></em></p>\r\n\r\n<p><em><strong>Chuy&ecirc;n ngh&agrave;nh: Tư&nbsp; vấn v&agrave; đ&agrave;o tạo về Quản l&yacute; Doanh Nghiệ</strong></em><strong>p</strong>.</p>\r\n\r\n<ol>\r\n	<li 0.2em=\"0px=\" background-image:=\"background-repeat:=\" float:=\"http:=\" images=\"jb_teatime=\" line-height:=\"luongltd.com=\" no-repeat=\"padding:=\" templates=\"\">Trụ sở ch&iacute;nh: 178 L&ecirc; Quang Định, Phường 14, Quận B&igrave;nh Thạnh, Th&agrave;nh phố Hồ Ch&iacute; Minh.</li>\r\n	<li>Văn ph&ograve;ng giao dịch: Lầu 2, 64 Trương Định, Phường 7, Quận 3, Th&agrave;nh phố Hồ Ch&iacute; Minh.</li>\r\n</ol>\r\n\r\n<p><br />\r\n<a color:=\"href=mailto:luong-company@vnn.vn\" href=\"mailto:luong-company@vnn.vn\">Email : luongcompany@gmail.com</a>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Website:</p>\r\n\r\n<ul>\r\n	<li><a href=\"http://luongltd.com\">luongltd.com</a></li>\r\n	<li><a href=\"https://tieuchuanfsc.com\">tieuchuanfsc.com</a></li>\r\n	<li><a href=\"https://tuvanchungnhanfsc.com\">tuvanchungnhanfsc.com</a></li>\r\n</ul>\r\n\r\n<p background-color:=\"font-family:=\" font-size:=\"padding-left:=\" text-align:=\"\">Điện thoại: 84-8-39.322.883&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; Fax: 84-8-39.322.391</p>\r\n', 'Công ty TNHH Tư Vấn Quản Lý Lương được thành lập, theo Giấy chứng nhận đăng ký kinh doanh số 4102039469 do Sở Kế Hoạch và Đầu Tư Thành Phố Hồ Chí Minh cấp ngày 17 tháng 5 năm 2006. Chuyên nghành: Tư  vấn và đào tạo về Quản lý Doanh Nghiệp. Trụ sở chính: 178 Lê Quang Định, Phường 14, Quận Bình Thạnh, Thành phố Hồ Chí Minh. Văn phòng giao dịch: Lầu 2, 64 Trương Định, Phường 7, Quận 3, Thành phố Hồ Chí Minh. Email : luongcompany@gmail.com        Website: luongltd.com tieuchuanfsc.com tuvanchungnhanfsc.com Điện thoại: 84-8-39.322.883            Fax: 84-8-39.322.391'),
(64, 55, '<p style=\"text-align: center;\"><strong>&ldquo;Giải ph&aacute;p quản l&yacute; doanh nghiệp hiệu quả&rdquo;<br />\r\n&ldquo;Cung cấp dịch vụ tốt nhất, thoả m&atilde;n nhu cầu của từng kh&aacute;ch h&agrave;ng&rdquo;</strong></p>\r\n', '“Giải pháp quản lý doanh nghiệp hiệu quả” “Cung cấp dịch vụ tốt nhất, thoả mãn nhu cầu của từng khách hàng”'),
(64, 56, '<p><em>Lu&ocirc;n mang đến cho kh&aacute;ch h&agrave;ng c&aacute;c giải ph&aacute;p mới nhất, ph&ugrave; hợp nhất trong quản l&yacute;.</em><br />\r\n<em>Lu&ocirc;n s&aacute;t c&aacute;nh c&ugrave;ng kh&aacute;ch h&agrave;ng giải quyết c&aacute;c vấn đề vướng mắc trong quản l&yacute;.</em><br />\r\n<em>Lu&ocirc;n thỏa m&atilde;n nhu cầu của kh&aacute;ch h&agrave;ng.</em><br />\r\n<em>Kh&ocirc;ng ngừng cải tiến mọi hoạt động nhằm cung cấp c&aacute;c dịch vụ tốt nhất đến kh&aacute;ch h&agrave;ng.</em></p>\r\n', 'Luôn mang đến cho khách hàng các giải pháp mới nhất, phù hợp nhất trong quản lý. Luôn sát cánh cùng khách hàng giải quyết các vấn đề vướng mắc trong quản lý. Luôn thỏa mãn nhu cầu của khách hàng. Không ngừng cải tiến mọi hoạt động nhằm cung cấp các dịch vụ tốt nhất đến khách hàng.'),
(64, 57, '<p>C&ocirc;ng ty TNHH Tư Vấn Quản L&yacute; Lương hoạt động chủ yếu tr&ecirc;n hai lĩnh vực<strong> đ&agrave;o tạo v&agrave; tư vấn </strong>hệ thống quản l&yacute; cho doanh nghiệp bao gồm c&aacute;c ti&ecirc;u chuẩn Quốc tế về quản l&yacute;:</p>\r\n\r\n<ul>\r\n	<li>Hệ thống quản l&yacute; chất lượng ISO 9000.</li>\r\n	<li>Hệ thống quản l&yacute; m&ocirc;i trường ISO 14000.</li>\r\n	<li>Hệ thống quản l&yacute; cho việc kiểm so&aacute;t sản xuất thiết bị y tế ISO 13485.</li>\r\n	<li>Hệ thống quản l&yacute; an to&agrave;n thực phẩm ISO 22000.</li>\r\n	<li>Hệ thống quản l&yacute; an to&agrave;n th&ocirc;ng tin ISO 27000.</li>\r\n	<li>Hệ thống quản l&yacute; an ninh chuỗi cung ứng ISO 28000.</li>\r\n	<li>Hệ thống ph&acirc;n t&iacute;ch c&aacute;c mối nguy v&agrave; kiểm so&aacute;t c&aacute;c điểm trọng yếu HACCP.</li>\r\n	<li>Ti&ecirc;u chuẩn thực h&agrave;nh n&ocirc;ng nghiệp tốt to&agrave;n cầu GLOBAL GAP.</li>\r\n	<li>Hệ thống quản l&yacute; về sức khỏe v&agrave; an to&agrave;n lao động OHSAS 18000.</li>\r\n	<li>Hệ thống quản l&yacute; về tr&aacute;ch nhiệm x&atilde; hội SA 8000.</li>\r\n	<li>Hệ thống quản l&yacute; rừng FSC-FM.</li>\r\n	<li>Hệ thống quản l&yacute; chuỗi h&agrave;nh tr&igrave;nh sản phẩm FSC-CoC/CW.</li>\r\n	<li>Hệ thống quản l&yacute; chuỗi h&agrave;nh tr&igrave;nh sản phẩm PEFC-CoC.</li>\r\n	<li>C&ocirc;ng ty đứng đầu về dịch vụ đ&agrave;o tạo v&agrave; tư vấn c&aacute;c ti&ecirc;u chuẩn FSC cho ng&agrave;nh chế biến gỗ v&agrave; l&acirc;m sản tại Việt Nam.</li>\r\n	<li>C&ocirc;ng ty đứng đầu về dịch vụ đ&agrave;o tạo v&agrave; tư vấn c&aacute;c ti&ecirc;u chuẩn GlobalGAP cho Tr&agrave;, Rau v&agrave; C&acirc;y ăn tr&aacute;i, T&ocirc;m&hellip;</li>\r\n</ul>\r\n\r\n<p>Ngo&agrave;i ra ch&uacute;ng t&ocirc;i c&ograve;n cung cấp chuy&ecirc;n gia đ&aacute;nh gi&aacute; theo c&aacute;c ti&ecirc;u chuẩn quốc tế cho c&aacute;c Tổ chức chứng nhận v&agrave; doanh nghiệp.</p>\r\n', 'Công ty TNHH Tư Vấn Quản Lý Lương hoạt động chủ yếu trên hai lĩnh vực đào tạo và tư vấn hệ thống quản lý cho doanh nghiệp bao gồm các tiêu chuẩn Quốc tế về quản lý: Hệ thống quản lý chất lượng ISO 9000. Hệ thống quản lý môi trường ISO 14000. Hệ thống quản lý cho việc kiểm soát sản xuất thiết bị y tế ISO 13485. Hệ thống quản lý an toàn thực phẩm ISO 22000. Hệ thống quản lý an toàn thông tin ISO 27000. Hệ thống quản lý an ninh chuỗi cung ứng ISO 28000. Hệ thống phân tích các mối nguy và kiểm soát các điểm trọng yếu HACCP. Tiêu chuẩn thực hành nông nghiệp tốt toàn cầu GLOBAL GAP. Hệ thống quản lý về sức khỏe và an toàn lao động OHSAS 18000. Hệ thống quản lý về trách nhiệm xã hội SA 8000. Hệ thống quản lý rừng FSC-FM. Hệ thống quản lý chuỗi hành trình sản phẩm FSC-CoC/CW. Hệ thống quản lý chuỗi hành trình sản phẩm PEFC-CoC. Công ty đứng đầu về dịch vụ đào tạo và tư vấn các tiêu chuẩn FSC cho ngành chế biến gỗ và lâm sản tại Việt Nam. Công ty đứng đầu về dịch vụ đào tạo và tư vấn các tiêu chuẩn GlobalGAP cho Trà, Rau và Cây ăn trái, Tôm… Ngoài ra chúng tôi còn cung cấp chuyên gia đánh giá theo các tiêu chuẩn quốc tế cho các Tổ chức chứng nhận và doanh nghiệp.'),
(64, 58, '<p><em><strong>C&ocirc;ng ty TNHH Tư Vấn Quản L&yacute; Lương được th&agrave;nh lập, theo Giấy chứng nhận đăng k&yacute; kinh doanh số 4102039469 do Sở Kế Hoạch v&agrave; Đầu Tư Th&agrave;nh Phố Hồ Ch&iacute; Minh cấp ng&agrave;y 17 th&aacute;ng 5 năm 2006.</strong></em></p>\r\n\r\n<p><em><strong>Chuy&ecirc;n ngh&agrave;nh: Tư&nbsp; vấn v&agrave; đ&agrave;o tạo về Quản l&yacute; Doanh Nghiệ</strong></em><strong>p</strong>.</p>\r\n\r\n<ol>\r\n	<li 0.2em=\"0px=\" background-image:=\"background-repeat:=\" float:=\"http:=\" images=\"jb_teatime=\" line-height:=\"luongltd.com=\" no-repeat=\"padding:=\" templates=\"\">Trụ sở ch&iacute;nh: 178 L&ecirc; Quang Định, Phường 14, Quận B&igrave;nh Thạnh, Th&agrave;nh phố Hồ Ch&iacute; Minh.</li>\r\n	<li>Văn ph&ograve;ng giao dịch: Lầu 2, 64 Trương Định, Phường 7, Quận 3, Th&agrave;nh phố Hồ Ch&iacute; Minh.</li>\r\n</ol>\r\n', 'Công ty TNHH Tư Vấn Quản Lý Lương được thành lập, theo Giấy chứng nhận đăng ký kinh doanh số 4102039469 do Sở Kế Hoạch và Đầu Tư Thành Phố Hồ Chí Minh cấp ngày 17 tháng 5 năm 2006. Chuyên nghành: Tư  vấn và đào tạo về Quản lý Doanh Nghiệp. Trụ sở chính: 178 Lê Quang Định, Phường 14, Quận Bình Thạnh, Thành phố Hồ Chí Minh. Văn phòng giao dịch: Lầu 2, 64 Trương Định, Phường 7, Quận 3, Thành phố Hồ Chí Minh.'),
