(65, 65, '<p><strong>I. &nbsp; &nbsp; &nbsp; H&Igrave;NH THỨC Đ&Agrave;O TẠO:</strong></p>\r\n\r\n<p>C&ocirc;ng ty TNHH Tư Vấn Quản L&yacute; Lương tiến h&agrave;nh thực hiện theo một trong c&aacute;c h&igrave;nh thức sau (t&ugrave;y theo y&ecirc;u cầu của kh&aacute;ch h&agrave;ng):</p>\r\n\r\n<p>+ &nbsp; &nbsp; &nbsp; &nbsp; Đ&agrave;o tạo tập trung cho từng Doanh nghiệp c&oacute; nhu cầu.</p>\r\n\r\n<p>+&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Đ&agrave;o tạo tập trung phối hợp nhiều Doanh nghiệp c&oacute; chung nhu cầu.</p>\r\n\r\n<p>+ &nbsp; &nbsp; &nbsp; &nbsp; Đ&agrave;o tạo th&ocirc;ng qua c&aacute;c đợt hội thảo chuy&ecirc;n đề cho nhiều Doanh nghiệp.</p>\r\n\r\n<p>C&aacute;c kh&oacute;a đ&agrave;o tạo được truyền đạt th&ocirc;ng qua c&aacute;c b&agrave;i giảng, t&agrave;i liệu, thảo luận nh&oacute;m v&agrave; c&aacute;c b&agrave;i tập.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>II. &nbsp; &nbsp; &nbsp;C&Aacute;C SẢN PHẨM Đ&Agrave;O TẠO:</strong></p>\r\n\r\n<p><strong>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hệ thống quản l&yacute; chất lượng &ndash; ISO 9000.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kho&aacute; đ&agrave;o tạo nhận thức v&agrave; diễn giải ti&ecirc;u chuẩn ISO 9001:2008.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kho&aacute; đ&agrave;o tạo thiết lập văn bản hệ thống quản l&yacute; chất lượng.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kho&aacute; đ&agrave;o tạo đ&aacute;nh gi&aacute; chất lượng nội bộ.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kh&oacute;a đ&agrave;o tạo phương ph&aacute;p thống k&ecirc; &ndash; ph&acirc;n t&iacute;ch dữ liệu.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kh&oacute;a đ&agrave;o tạo ISO 9004:2000 &ndash; Cải tiến hệ thống quản l&yacute; chất lượng.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hệ thống quản l&yacute; m&ocirc;i trường &ndash; ISO 14000</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kho&aacute; đ&agrave;o tạo nhận thức v&agrave; diễn giải ti&ecirc;u chuẩn ISO 14001:2004.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kho&aacute; đ&agrave;o tạo thiết lập văn bản hệ thống quản l&yacute; m&ocirc;i trường.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hệ thống quản l&yacute; về tr&aacute;ch nhiệm x&atilde; hội SA8000</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kho&aacute; đ&agrave;o tạo nhận thức về tr&aacute;ch nhiệm x&atilde; hội.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kho&aacute; đ&agrave;o tạo diễn giải ti&ecirc;u chuẩn SA 8000:2008.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hệ thống quản l&yacute; an to&agrave;n thực phẩm &ndash; ISO 22000</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kho&aacute; đ&agrave;o tạo nhận thức v&agrave; diễn giải ti&ecirc;u chuẩn ISO 22000:2005.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kho&aacute; đ&agrave;o tạo thiết lập văn bản hệ thống quản l&yacute; an to&agrave;n thực phẩm.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hệ thống ph&acirc;n t&iacute;ch c&aacute;c mối nguy v&agrave; kiểm so&aacute;t c&aacute;c điểm trọng yếu - HACCP</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kho&aacute; đ&agrave;o tạo nhận thức v&agrave; diễn giải ti&ecirc;u chuẩn HACCP.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kho&aacute; đ&agrave;o tạo thiết lập văn bản hệ thống HACCP.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hệ thống quản l&yacute; chuỗi h&agrave;nh tr&igrave;nh sản phẩm FSC-CoC</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kh&oacute;a đ&agrave;o tạo nhận thức v&agrave; diễn giải ti&ecirc;u chuẩn FSC-CoC bao gồm c&aacute;c ti&ecirc;u chuẩn:</p>\r\n\r\n<ul>\r\n	<li>FSC-STD-40-004 (Version 3) :&nbsp;Ti&ecirc;u chuẩn chuỗi h&agrave;nh tr&igrave;nh sản phẩm FSC đối với c&aacute;c c&ocirc;ng ty cung cấp v&agrave; chế biến sản phẩm c&oacute; chứng nhận FSC</li>\r\n	<li>FSC-STD-40-005 (Version 3)&nbsp; :&nbsp;Ti&ecirc;u chuẩn FSC d&agrave;nh cho c&aacute;c c&ocirc;ng ty đ&aacute;nh gi&aacute; nguồn gỗ c&oacute; kiểm so&aacute;t FSC</li>\r\n	<li>FSC-STD-30-010 (Version 2)&nbsp; :&nbsp;Ti&ecirc;u chuẩn gỗ c&oacute; kiểm so&aacute;t FSC d&agrave;nh cho c&aacute;c tổ chức quản l&yacute; rừng</li>\r\n	<li>FSC-STD-50-001 (Version 1)&nbsp; :&nbsp;C&aacute;c y&ecirc;u cầu d&aacute;n nh&atilde;n FSC tr&ecirc;n sản phẩm</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ti&ecirc;u chuẩn thực h&agrave;nh n&ocirc;ng nghiệp tốt to&agrave;n cầu Global GAP</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kh&oacute;a đ&agrave;o tạo nhận thức v&agrave; diễn giải ti&ecirc;u chuẩn Global GAP &aacute;p dụng cho c&aacute;c n&ocirc;ng trại trồng c&acirc;y ăn tr&aacute;i v&agrave; rau quả.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kh&oacute;a đ&agrave;o tạo nhận thức v&agrave; diễn giải ti&ecirc;u chuẩn Global GAP &aacute;p dụng cho c&aacute;c n&ocirc;ng trại trồng hoa v&agrave; c&acirc;y cảnh.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kh&oacute;a đ&agrave;o tạo nhận thức v&agrave; diễn giải ti&ecirc;u chuẩn Global GAP &aacute;p dụng cho c&aacute;c n&ocirc;ng trại trồng c&acirc;y hỗn hợp.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kh&oacute;a đ&agrave;o tạo nhận thức v&agrave; diễn giải ti&ecirc;u chuẩn Global GAP &aacute;p dụng cho c&aacute;c n&ocirc;ng trại trồng c&agrave; ph&ecirc;.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kh&oacute;a đ&agrave;o tạo nhận thức v&agrave; diễn giải ti&ecirc;u chuẩn Global GAP &aacute;p dụng cho c&aacute;c n&ocirc;ng trại trồng tr&agrave;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>8. &nbsp; &nbsp; &nbsp;Kh&oacute;a học &quot;Nghiệp vụ Ngoại thương&quot;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kh&oacute;a học n&agrave;y trang bị những kiến thức v&agrave; kỹ năng về kinh doanh xuất nhập khẩu như :&nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; C&aacute;c phương thức giao dịch phổ biến tr&ecirc;n thị trường thế giới v&agrave; một số lưu &yacute; khi thực hiện tại Việt Nam</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hợp đồng ngoại thương</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; C&aacute;c điều kiện thương mại quốc tế (INCOTERMS)</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; C&aacute;c phương thức thanh to&aacute;n quốc tế phổ biến</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Vận tải h&agrave;ng h&oacute;a xuất nhập khẩu</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Bảo hiểm h&agrave;ng h&oacute;a xuất nhập khẩu</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Đọc hiểu, biết c&aacute;ch kiểm tra v&agrave; lập ch&iacute;nh x&aacute;c v&agrave; xử l&yacute; c&aacute;c sai biệt đối với c&aacute;c chứng từ thường d&ugrave;ng trong giao dịch thương mại quốc tế</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Logistics trong giao dịch thương mại quốc tế</p>\r\n', 'I.       HÌNH THỨC ĐÀO TẠO: Công ty TNHH Tư Vấn Quản Lý Lương tiến hành thực hiện theo một trong các hình thức sau (tùy theo yêu cầu của khách hàng): +         Đào tạo tập trung cho từng Doanh nghiệp có nhu cầu. +         Đào tạo tập trung phối hợp nhiều Doanh nghiệp có chung nhu cầu. +         Đào tạo thông qua các đợt hội thảo chuyên đề cho nhiều Doanh nghiệp. Các khóa đào tạo được truyền đạt thông qua các bài giảng, tài liệu, thảo luận nhóm và các bài tập.   II.      CÁC SẢN PHẨM ĐÀO TẠO: 1.      Hệ thống quản lý chất lượng – ISO 9000.   -         Khoá đào tạo nhận thức và diễn giải tiêu chuẩn ISO 9001:2008. -         Khoá đào tạo thiết lập văn bản hệ thống quản lý chất lượng. -         Khoá đào tạo đánh giá chất lượng nội bộ. -         Khóa đào tạo phương pháp thống kê – phân tích dữ liệu. -         Khóa đào tạo ISO 9004:2000 – Cải tiến hệ thống quản lý chất lượng.   2.      Hệ thống quản lý môi trường – ISO 14000   -         Khoá đào tạo nhận thức và diễn giải tiêu chuẩn ISO 14001:2004. -         Khoá đào tạo thiết lập văn bản hệ thống quản lý môi trường.   3.      Hệ thống quản lý về trách nhiệm xã hội SA8000   -         Khoá đào tạo nhận thức về trách nhiệm xã hội. -         Khoá đào tạo diễn giải tiêu chuẩn SA 8000:2008.   4.      Hệ thống quản lý an toàn thực phẩm – ISO 22000   -         Khoá đào tạo nhận thức và diễn giải tiêu chuẩn ISO 22000:2005. -         Khoá đào tạo thiết lập văn bản hệ thống quản lý an toàn thực phẩm.   5.      Hệ thống phân tích các mối nguy và kiểm soát các điểm trọng yếu - HACCP   -         Khoá đào tạo nhận thức và diễn giải tiêu chuẩn HACCP. -         Khoá đào tạo thiết lập văn bản hệ thống HACCP.   6.      Hệ thống quản lý chuỗi hành trình sản phẩm FSC-CoC   -         Khóa đào tạo nhận thức và diễn giải tiêu chuẩn FSC-CoC bao gồm các tiêu chuẩn: FSC-STD-40-004 (Version 3) : Tiêu chuẩn chuỗi hành trình sản phẩm FSC đối với các công ty cung cấp và chế biến sản phẩm có chứng nhận FSC FSC-STD-40-005 (Version 3)  : Tiêu chuẩn FSC dành cho các công ty đánh giá nguồn gỗ có kiểm soát FSC FSC-STD-30-010 (Version 2)  : Tiêu chuẩn gỗ có kiểm soát FSC dành cho các tổ chức quản lý rừng FSC-STD-50-001 (Version 1)  : Các yêu cầu dán nhãn FSC trên sản phẩm   7.      Tiêu chuẩn thực hành nông nghiệp tốt toàn cầu Global GAP   -         Khóa đào tạo nhận thức và diễn giải tiêu chuẩn Global GAP áp dụng cho các nông trại trồng cây ăn trái và rau quả. -         Khóa đào tạo nhận thức và diễn giải tiêu chuẩn Global GAP áp dụng cho các nông trại trồng hoa và cây cảnh. -         Khóa đào tạo nhận thức và diễn giải tiêu chuẩn Global GAP áp dụng cho các nông trại trồng cây hỗn hợp. -         Khóa đào tạo nhận thức và diễn giải tiêu chuẩn Global GAP áp dụng cho các nông trại trồng cà phê. -         Khóa đào tạo nhận thức và diễn giải tiêu chuẩn Global GAP áp dụng cho các nông trại trồng trà.   8.      Khóa học &quot;Nghiệp vụ Ngoại thương&quot;   Khóa học này trang bị những kiến thức và kỹ năng về kinh doanh xuất nhập khẩu như :  -         Các phương thức giao dịch phổ biến trên thị trường thế giới và một số lưu ý khi thực hiện tại Việt Nam -         Hợp đồng ngoại thương -         Các điều kiện thương mại quốc tế (INCOTERMS) -         Các phương thức thanh toán quốc tế phổ biến -         Vận tải hàng hóa xuất nhập khẩu -         Bảo hiểm hàng hóa xuất nhập khẩu -         Đọc hiểu, biết cách kiểm tra và lập chính xác và xử lý các sai biệt đối với các chứng từ thường dùng trong giao dịch thương mại quốc tế -         Logistics trong giao dịch thương mại quốc tế'),
(66, 66, '<p><strong>I - H&Igrave;NH THỨC THỰC HIỆN CHƯƠNG TR&Igrave;NH TƯ VẤN:</strong></p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; C&ocirc;ng ty TNHH Tư Vấn Quản L&yacute; Lương tiến h&agrave;nh thực hiện chương tr&igrave;nh tư vấn ri&ecirc;ng ph&ugrave; hợp cho từng Doanh nghiệp c&oacute; nhu cầu tư vấn.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Chương tr&igrave;nh tư vấn được thực hiện th&ocirc;ng qua c&aacute;c kho&aacute; đ&agrave;o tạo về ti&ecirc;u chuẩn, hướng dẫn cho c&aacute;c bộ phận li&ecirc;n quan x&acirc;y dựng v&agrave; &aacute;p dụng hệ thống văn bản v&agrave;o thực tế.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>II - C&Aacute;C SẢN PHẨM TƯ VẤN</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'I - HÌNH THỨC THỰC HIỆN CHƯƠNG TRÌNH TƯ VẤN: -         Công ty TNHH Tư Vấn Quản Lý Lương tiến hành thực hiện chương trình tư vấn riêng phù hợp cho từng Doanh nghiệp có nhu cầu tư vấn. -         Chương trình tư vấn được thực hiện thông qua các khoá đào tạo về tiêu chuẩn, hướng dẫn cho các bộ phận liên quan xây dựng và áp dụng hệ thống văn bản vào thực tế.   II - CÁC SẢN PHẨM TƯ VẤN  '),
(66, 67, ':hinh-top-3.jpg', 'hinh-top-3.jpg'),
(67, 68, '<p><strong>I - CHƯƠNG TR&Igrave;NH TƯ VẤN X&Acirc;Y DỰNG V&Agrave; &Aacute;P DỤNG HỆ THỐNG QUẢN L&Yacute; CHẤT LƯỢNG THEO TI&Ecirc;U CHUẨN ISO 9001:2008</strong></p>\r\n\r\n<p><strong>1.&nbsp;Khảo s&aacute;t c&ocirc;ng ty</strong></p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Trước khi bắt đầu chương tr&igrave;nh tư vấn x&acirc;y dựng v&agrave; &aacute;p dụng hệ thống quản l&yacute;, C&ocirc;ng ty TNHH Tư Vấn Quản L&yacute; Lương sẽ xem x&eacute;t quy m&ocirc; v&agrave; phạm vi tư vấn tại Qu&yacute; C&ocirc;ng ty.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Việc xem x&eacute;t quy m&ocirc; v&agrave; phạm vi tư vấn sẽ cho ch&uacute;ng ta c&oacute; được c&aacute;i nh&igrave;n tổng quan về hệ thống quản l&yacute; v&agrave; x&aacute;c định c&aacute;c ph&ograve;ng ban, bộ phận sẽ phải tham gia v&agrave;o chương tr&igrave;nh hoặc c&aacute;c điều khoản trong ti&ecirc;u chuẩn c&oacute; thể được loại trừ theo t&igrave;nh h&igrave;nh thực tế tại doanh nghiệp.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Chương tr&igrave;nh khảo s&aacute;t c&ocirc;ng ty sẽ được tiến h&agrave;nh trong v&ograve;ng 1 ng&agrave;y c&ocirc;ng v&agrave; được thực hiện tại Qu&yacute; C&ocirc;ng ty.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Chương tr&igrave;nh khảo s&aacute;t c&ocirc;ng ty sẽ được thực hiện miễn ph&iacute;.</p>\r\n\r\n<p><strong>2.&nbsp;C&aacute;c lớp đ&agrave;o tạo</strong></p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; C&aacute;c lớp đ&agrave;o tạo từ sơ cấp đến n&acirc;ng cao sẽ truyền đạt to&agrave;n bộ kiến thức cho học vi&ecirc;n để c&oacute; thể vận dụng tốt ti&ecirc;u chuẩn Quản L&yacute; Chất Lượng ISO 9001:2008 v&agrave;o t&igrave;nh h&igrave;nh thực tế tại Qu&yacute; C&ocirc;ng ty.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; C&aacute;c kh&oacute;a đ&agrave;o tạo bao gồm:</p>\r\n\r\n<blockquote>\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Đ&agrave;o tạo lớp nhận thức.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Diễn giải thuật ngữ v&agrave; ti&ecirc;u chuẩn ISO 9001:2008.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Đ&agrave;o tạo lớp x&acirc;y dựng hệ thống t&agrave;i liệu ISO 9001:2008.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Đ&agrave;o tạo lớp đ&aacute;nh gi&aacute; chất lượng nội bộ.</p>\r\n</blockquote>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sau c&aacute;c kh&oacute;a đ&agrave;o tạo, c&aacute;c học vi&ecirc;n sẽ c&oacute; khả&nbsp; năng x&acirc;y dựng v&agrave; quản l&yacute; hệ thống t&agrave;i liệu-hồ sơ, x&acirc;y dựng hệ thống văn bản, &aacute;p dụng hệ thống quản l&yacute; v&agrave; trở th&agrave;nh c&aacute;c chuy&ecirc;n vi&ecirc;n đ&aacute;nh gi&aacute; nội bộ.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sau mỗi lớp học, ch&uacute;ng t&ocirc;i sẽ tổ chức c&aacute;c buổi kiểm tra.</p>\r\n\r\n<p><strong>3.&nbsp;Chương tr&igrave;nh tư vấn</strong></p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Chương tr&igrave;nh tư vấn sẽ gồm nhiều bước, được thực hiện nhằm x&acirc;y dựng v&agrave; &aacute;p dụng hệ thống quản l&yacute; chất lượng theo ti&ecirc;u chuẩn ISO 9001:2008 theo m&ocirc; h&igrave;nh của Qu&yacute; C&ocirc;ng ty bao gồm:</p>\r\n\r\n<blockquote>\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Điều chỉnh c&aacute;c m&ocirc; tả c&ocirc;ng việc theo cơ cấu tổ chức Qu&yacute; C&ocirc;ng ty.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; X&aacute;c định phạm vi hệ thống quản l&yacute; chất lượng.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; X&aacute;c định x&acirc;y dựng v&agrave; bổ sung cơ cấu tổ chức.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; X&aacute;c định ma trận tr&aacute;ch nhiệm của c&aacute;c bộ phận theo ti&ecirc;u chuẩn ISO 9001:2008.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Th&agrave;nh lập ban chất lượng v&agrave; x&aacute;c định kế hoạch triển khai x&acirc;y dựng t&agrave;i liệu.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; X&acirc;y dựng 06 quy tr&igrave;nh cơ bản theo y&ecirc;u cầu của ti&ecirc;u chuẩn ISO 9001:2008.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; X&acirc;y dựng c&aacute;c thủ tục t&aacute;c nghiệp theo y&ecirc;u cầu của hệ thống</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; X&acirc;y dựng c&aacute;c hướng dẫn c&ocirc;ng việc.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; X&acirc;y dựng c&aacute;c quy định t&aacute;c nghiệp.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; X&acirc;y dựng ch&iacute;nh s&aacute;ch chất lượng.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; X&acirc;y dựng c&aacute;c mục ti&ecirc;u chất lượng v&agrave; kế hoạch h&agrave;nh động</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; X&acirc;y dựng sổ tay chất lượng.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Theo d&otilde;i v&agrave; điều chỉnh &aacute;p dụng hệ thống.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Thực hiện đ&aacute;nh gi&aacute; chất lượng nội bộ.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hướng dẫn thực hiện c&aacute;c h&agrave;nh động khắc phục, ph&ograve;ng ngừa.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Họp xem x&eacute;t l&atilde;nh đạo.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ho&agrave;n chỉnh hệ thống t&agrave;i liệu v&agrave; ban h&agrave;nh &aacute;p dụng tổng thể.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hỗ trợ đ&aacute;nh gi&aacute; chứng nhận ch&iacute;nh thức.</p>\r\n</blockquote>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hướng dẫn thực hiện c&aacute;c h&agrave;nh động khắc phục, ph&ograve;ng ngừa sau đ&aacute;nh gi&aacute; ch&iacute;nh thức.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Chương tr&igrave;nh Tư Vấn X&acirc;y Dựng v&agrave; &Aacute;p Dụng Hệ Thống Quản L&yacute; Chất Lượng theo ti&ecirc;u chuẩn ISO 9001:2008 sẽ được thực hiện bởi c&aacute;c chuy&ecirc;n vi&ecirc;n c&oacute; nhiều kinh nghiệm v&agrave; được c&aacute;c tổ chức quốc tế c&ocirc;ng nhận.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Thời gian cụ thể tiến h&agrave;nh tư vấn sẽ được thống nhất bằng văn bản giữa hai b&ecirc;n.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>II - C&Aacute;C DỊCH VỤ HỖ TRỢ LI&Ecirc;N QUAN ĐẾN CHƯƠNG TR&Igrave;NH Đ&Agrave;O TẠO &amp; TƯ VẤN</strong></p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Đăng k&yacute; tổ chức đ&aacute;nh gi&aacute; chứng nhận.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hướng dẫn thực hiện c&aacute;c h&agrave;nh động khắc phục, ph&ograve;ng ngừa sau đ&aacute;nh gi&aacute; ch&iacute;nh thức.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Giảm gi&aacute; t&aacute;i đ&agrave;o tạo/t&aacute;i cấu tr&uacute;c Hệ Thống Quản L&yacute; Chất Lượng cho c&aacute;c kh&aacute;ch h&agrave;ng đ&atilde; k&yacute; hợp đồng với C&ocirc;ng ty TNHH Tư Vấn Quản L&yacute; Lương.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Giới thiệu những đối t&aacute;c tiềm năng trong danh s&aacute;ch kh&aacute;ch h&agrave;ng của C&ocirc;ng ty TNHH Tư Vấn Quản L&yacute; Lương.</p>\r\n\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Đảm bảo phương thức dịch vụ tư vấn - đ&agrave;o tạo v&agrave; phương thức thanh to&aacute;n linh hoạt, thuận lợi v&agrave; dựa tr&ecirc;n kế hoạch thuận tiện nhất cho Qu&yacute; C&ocirc;ng ty.</p>\r\n', 'I - CHƯƠNG TRÌNH TƯ VẤN XÂY DỰNG VÀ ÁP DỤNG HỆ THỐNG QUẢN LÝ CHẤT LƯỢNG THEO TIÊU CHUẨN ISO 9001:2008 1. Khảo sát công ty -      Trước khi bắt đầu chương trình tư vấn xây dựng và áp dụng hệ thống quản lý, Công ty TNHH Tư Vấn Quản Lý Lương sẽ xem xét quy mô và phạm vi tư vấn tại Quý Công ty. -      Việc xem xét quy mô và phạm vi tư vấn sẽ cho chúng ta có được cái nhìn tổng quan về hệ thống quản lý và xác định các phòng ban, bộ phận sẽ phải tham gia vào chương trình hoặc các điều khoản trong tiêu chuẩn có thể được loại trừ theo tình hình thực tế tại doanh nghiệp. -      Chương trình khảo sát công ty sẽ được tiến hành trong vòng 1 ngày công và được thực hiện tại Quý Công ty. -      Chương trình khảo sát công ty sẽ được thực hiện miễn phí. 2. Các lớp đào tạo -      Các lớp đào tạo từ sơ cấp đến nâng cao sẽ truyền đạt toàn bộ kiến thức cho học viên để có thể vận dụng tốt tiêu chuẩn Quản Lý Chất Lượng ISO 9001:2008 vào tình hình thực tế tại Quý Công ty. -      Các khóa đào tạo bao gồm: ·         Đào tạo lớp nhận thức. ·         Diễn giải thuật ngữ và tiêu chuẩn ISO 9001:2008. ·         Đào tạo lớp xây dựng hệ thống tài liệu ISO 9001:2008. ·         Đào tạo lớp đánh giá chất lượng nội bộ. -      Sau các khóa đào tạo, các học viên sẽ có khả  năng xây dựng và quản lý hệ thống tài liệu-hồ sơ, xây dựng hệ thống văn bản, áp dụng hệ thống quản lý và trở thành các chuyên viên đánh giá nội bộ. -      Sau mỗi lớp học, chúng tôi sẽ tổ chức các buổi kiểm tra. 3. Chương trình tư vấn -      Chương trình tư vấn sẽ gồm nhiều bước, được thực hiện nhằm xây dựng và áp dụng hệ thống quản lý chất lượng theo tiêu chuẩn ISO 9001:2008 theo mô hình của Quý Công ty bao gồm: ·         Điều chỉnh các mô tả công việc theo cơ cấu tổ chức Quý Công ty. ·         Xác định phạm vi hệ thống quản lý chất lượng. ·         Xác định xây dựng và bổ sung cơ cấu tổ chức. ·         Xác định ma trận trách nhiệm của các bộ phận theo tiêu chuẩn ISO 9001:2008. ·         Thành lập ban chất lượng và xác định kế hoạch triển khai xây dựng tài liệu. ·         Xây dựng 06 quy trình cơ bản theo yêu cầu của tiêu chuẩn ISO 9001:2008. ·         Xây dựng các thủ tục tác nghiệp theo yêu cầu của hệ thống ·         Xây dựng các hướng dẫn công việc. ·         Xây dựng các quy định tác nghiệp. ·         Xây dựng chính sách chất lượng. ·         Xây dựng các mục tiêu chất lượng và kế hoạch hành động ·         Xây dựng sổ tay chất lượng. ·         Theo dõi và điều chỉnh áp dụng hệ thống. ·         Thực hiện đánh giá chất lượng nội bộ. ·         Hướng dẫn thực hiện các hành động khắc phục, phòng ngừa. ·         Họp xem xét lãnh đạo. ·         Hoàn chỉnh hệ thống tài liệu và ban hành áp dụng tổng thể. ·         Hỗ trợ đánh giá chứng nhận chính thức. -      Hướng dẫn thực hiện các hành động khắc phục, phòng ngừa sau đánh giá chính thức. -      Chương trình Tư Vấn Xây Dựng và Áp Dụng Hệ Thống Quản Lý Chất Lượng theo tiêu chuẩn ISO 9001:2008 sẽ được thực hiện bởi các chuyên viên có nhiều kinh nghiệm và được các tổ chức quốc tế công nhận. -      Thời gian cụ thể tiến hành tư vấn sẽ được thống nhất bằng văn bản giữa hai bên.   II - CÁC DỊCH VỤ HỖ TRỢ LIÊN QUAN ĐẾN CHƯƠNG TRÌNH ĐÀO TẠO &amp; TƯ VẤN -      Đăng ký tổ chức đánh giá chứng nhận. -      Hướng dẫn thực hiện các hành động khắc phục, phòng ngừa sau đánh giá chính thức. -      Giảm giá tái đào tạo/tái cấu trúc Hệ Thống Quản Lý Chất Lượng cho các khách hàng đã ký hợp đồng với Công ty TNHH Tư Vấn Quản Lý Lương. -      Giới thiệu những đối tác tiềm năng trong danh sách khách hàng của Công ty TNHH Tư Vấn Quản Lý Lương. -      Đảm bảo phương thức dịch vụ tư vấn - đào tạo và phương thức thanh toán linh hoạt, thuận lợi và dựa trên kế hoạch thuận tiện nhất cho Quý Công ty.'),
