(64, 'Default page for gioi-thieu-cong-ty.php * PLEASE CHANGE THIS TITLE *', 'Công ty TNHH Tư Vấn Quản Lý Lương được thành lập, theo Giấy chứng nhận đăng ký kinh doanh số 4102039469 do Sở Kế Hoạch và Đầu Tư Thành Phố Hồ Chí Minh cấp ngày 17 tháng 5 năm 2006. Chuyên nghành: Tư  vấn và đào tạo về Quản lý Doanh Nghiệp. Trụ sở chính: 178 Lê Quang Định, Phường 14, Quận Bình Thạnh, Thành phố Hồ Chí Minh. Văn phòng giao dịch: Lầu 2, 64 Trương Định, Phường 7, Quận 3, Thành phố Hồ Chí Minh. Email : luongcompany@gmail.com        Website: luongltd.com tieuchuanfsc.com tuvanchungnhanfsc.com Điện thoại: 84-8-39.322.883            Fax: 84-8-39.322.391 “Giải pháp quản lý doanh nghiệp hiệu quả” “Cung cấp dịch vụ tốt nhất, thoả mãn nhu cầu của từng khách hàng” Luôn mang đến cho khách hàng các giải pháp mới nhất, phù hợp nhất trong quản lý. Luôn sát cánh cùng khách hàng giải quyết các vấn đề vướng mắc trong quản lý. Luôn thỏa mãn nhu cầu của khách hàng. Không ngừng cải tiến mọi hoạt động nhằm cung cấp các dịch vụ tốt nhất đến khách hàng. Công ty TNHH Tư Vấn Quản Lý Lương hoạt động chủ yếu trên hai lĩnh vực đào tạo và tư vấn hệ thống quản lý cho doanh nghiệp bao gồm các tiêu chuẩn Quốc tế về quản lý: Hệ thống quản lý chất lượng ISO 9000. Hệ thống quản lý môi trường ISO 14000. Hệ thống quản lý cho việc kiểm soát sản xuất thiết bị y tế ISO 13485. Hệ thống quản lý an toàn thực phẩm ISO 22000. Hệ thống quản lý an toàn thông tin ISO 27000. Hệ thống quản lý an ninh chuỗi cung ứng ISO 28000. Hệ thống phân tích các mối nguy và kiểm soát các điểm trọng yếu HACCP. Tiêu chuẩn thực hành nông nghiệp tốt toàn cầu GLOBAL GAP. Hệ thống quản lý về sức khỏe và an toàn lao động OHSAS 18000. Hệ thống quản lý về trách nhiệm xã hội SA 8000. Hệ thống quản lý rừng FSC-FM. Hệ thống quản lý chuỗi hành trình sản phẩm FSC-CoC/CW. Hệ thống quản lý chuỗi hành trình sản phẩm PEFC-CoC. Công ty đứng đầu về dịch vụ đào tạo và tư vấn các tiêu chuẩn FSC cho ngành chế biến gỗ và lâm sản tại Việt Nam. Công ty đứng đầu về dịch vụ đào tạo và tư vấn các tiêu chuẩn GlobalGAP cho Trà, Rau và Cây ăn trái, Tôm… Ngoài ra chúng tôi còn cung cấp chuyên gia đánh giá theo các tiêu chuẩn quốc tế cho các Tổ chức chứng nhận và doanh nghiệp. Công ty TNHH Tư Vấn Quản Lý Lương được thành lập, theo Giấy chứng nhận đăng ký kinh doanh số 4102039469 do Sở Kế Hoạch và Đầu Tư Thành Phố Hồ Chí Minh cấp ngày 17 tháng 5 năm 2006. Chuyên nghành: Tư  vấn và đào tạo về Quản lý Doanh Nghiệp. Trụ sở chính: 178 Lê Quang Định, Phường 14, Quận Bình Thạnh, Thành phố Hồ Chí Minh. Văn phòng giao dịch: Lầu 2, 64 Trương Định, Phường 7, Quận 3, Thành phố Hồ Chí Minh. '),
(65, 'Default page for dich-vu-dao-tao.php * PLEASE CHANGE THIS TITLE *', 'I.       HÌNH THỨC ĐÀO TẠO: Công ty TNHH Tư Vấn Quản Lý Lương tiến hành thực hiện theo một trong các hình thức sau (tùy theo yêu cầu của khách hàng): +         Đào tạo tập trung cho từng Doanh nghiệp có nhu cầu. +         Đào tạo tập trung phối hợp nhiều Doanh nghiệp có chung nhu cầu. +         Đào tạo thông qua các đợt hội thảo chuyên đề cho nhiều Doanh nghiệp. Các khóa đào tạo được truyền đạt thông qua các bài giảng, tài liệu, thảo luận nhóm và các bài tập.   II.      CÁC SẢN PHẨM ĐÀO TẠO: 1.      Hệ thống quản lý chất lượng – ISO 9000.   -         Khoá đào tạo nhận thức và diễn giải tiêu chuẩn ISO 9001:2008. -         Khoá đào tạo thiết lập văn bản hệ thống quản lý chất lượng. -         Khoá đào tạo đánh giá chất lượng nội bộ. -         Khóa đào tạo phương pháp thống kê – phân tích dữ liệu. -         Khóa đào tạo ISO 9004:2000 – Cải tiến hệ thống quản lý chất lượng.   2.      Hệ thống quản lý môi trường – ISO 14000   -         Khoá đào tạo nhận thức và diễn giải tiêu chuẩn ISO 14001:2004. -         Khoá đào tạo thiết lập văn bản hệ thống quản lý môi trường.   3.      Hệ thống quản lý về trách nhiệm xã hội SA8000   -         Khoá đào tạo nhận thức về trách nhiệm xã hội. -         Khoá đào tạo diễn giải tiêu chuẩn SA 8000:2008.   4.      Hệ thống quản lý an toàn thực phẩm – ISO 22000   -         Khoá đào tạo nhận thức và diễn giải tiêu chuẩn ISO 22000:2005. -         Khoá đào tạo thiết lập văn bản hệ thống quản lý an toàn thực phẩm.   5.      Hệ thống phân tích các mối nguy và kiểm soát các điểm trọng yếu - HACCP   -         Khoá đào tạo nhận thức và diễn giải tiêu chuẩn HACCP. -         Khoá đào tạo thiết lập văn bản hệ thống HACCP.   6.      Hệ thống quản lý chuỗi hành trình sản phẩm FSC-CoC   -         Khóa đào tạo nhận thức và diễn giải tiêu chuẩn FSC-CoC bao gồm các tiêu chuẩn: FSC-STD-40-004 (Version 3) : Tiêu chuẩn chuỗi hành trình sản phẩm FSC đối với các công ty cung cấp và chế biến sản phẩm có chứng nhận FSC FSC-STD-40-005 (Version 3)  : Tiêu chuẩn FSC dành cho các công ty đánh giá nguồn gỗ có kiểm soát FSC FSC-STD-30-010 (Version 2)  : Tiêu chuẩn gỗ có kiểm soát FSC dành cho các tổ chức quản lý rừng FSC-STD-50-001 (Version 1)  : Các yêu cầu dán nhãn FSC trên sản phẩm   7.      Tiêu chuẩn thực hành nông nghiệp tốt toàn cầu Global GAP   -         Khóa đào tạo nhận thức và diễn giải tiêu chuẩn Global GAP áp dụng cho các nông trại trồng cây ăn trái và rau quả. -         Khóa đào tạo nhận thức và diễn giải tiêu chuẩn Global GAP áp dụng cho các nông trại trồng hoa và cây cảnh. -         Khóa đào tạo nhận thức và diễn giải tiêu chuẩn Global GAP áp dụng cho các nông trại trồng cây hỗn hợp. -         Khóa đào tạo nhận thức và diễn giải tiêu chuẩn Global GAP áp dụng cho các nông trại trồng cà phê. -         Khóa đào tạo nhận thức và diễn giải tiêu chuẩn Global GAP áp dụng cho các nông trại trồng trà.   8.      Khóa học &quot;Nghiệp vụ Ngoại thương&quot;   Khóa học này trang bị những kiến thức và kỹ năng về kinh doanh xuất nhập khẩu như :  -         Các phương thức giao dịch phổ biến trên thị trường thế giới và một số lưu ý khi thực hiện tại Việt Nam -         Hợp đồng ngoại thương -         Các điều kiện thương mại quốc tế (INCOTERMS) -         Các phương thức thanh toán quốc tế phổ biến -         Vận tải hàng hóa xuất nhập khẩu -         Bảo hiểm hàng hóa xuất nhập khẩu -         Đọc hiểu, biết cách kiểm tra và lập chính xác và xử lý các sai biệt đối với các chứng từ thường dùng trong giao dịch thương mại quốc tế -         Logistics trong giao dịch thương mại quốc tế '),
(66, 'Default page for dich-vu-tu-van.php * PLEASE CHANGE THIS TITLE *', 'I - HÌNH THỨC THỰC HIỆN CHƯƠNG TRÌNH TƯ VẤN: -         Công ty TNHH Tư Vấn Quản Lý Lương tiến hành thực hiện chương trình tư vấn riêng phù hợp cho từng Doanh nghiệp có nhu cầu tư vấn. -         Chương trình tư vấn được thực hiện thông qua các khoá đào tạo về tiêu chuẩn, hướng dẫn cho các bộ phận liên quan xây dựng và áp dụng hệ thống văn bản vào thực tế.   II - CÁC SẢN PHẨM TƯ VẤN   '),
(67, 'Tư vấn Xây dựng và Áp dụng Hệ thống Quản lý Chất lượng theo Tiêu chuẩn ISO 9001:2008', 'I - CHƯƠNG TRÌNH TƯ VẤN XÂY DỰNG VÀ ÁP DỤNG HỆ THỐNG QUẢN LÝ CHẤT LƯỢNG THEO TIÊU CHUẨN ISO 9001:2008 1. Khảo sát công ty -      Trước khi bắt đầu chương trình tư vấn xây dựng và áp dụng hệ thống quản lý, Công ty TNHH Tư Vấn Quản Lý Lương sẽ xem xét quy mô và phạm vi tư vấn tại Quý Công ty. -      Việc xem xét quy mô và phạm vi tư vấn sẽ cho chúng ta có được cái nhìn tổng quan về hệ thống quản lý và xác định các phòng ban, bộ phận sẽ phải tham gia vào chương trình hoặc các điều khoản trong tiêu chuẩn có thể được loại trừ theo tình hình thực tế tại doanh nghiệp. -      Chương trình khảo sát công ty sẽ được tiến hành trong vòng 1 ngày công và được thực hiện tại Quý Công ty. -      Chương trình khảo sát công ty sẽ được thực hiện miễn phí. 2. Các lớp đào tạo -      Các lớp đào tạo từ sơ cấp đến nâng cao sẽ truyền đạt toàn bộ kiến thức cho học viên để có thể vận dụng tốt tiêu chuẩn Quản Lý Chất Lượng ISO 9001:2008 vào tình hình thực tế tại Quý Công ty. -      Các khóa đào tạo bao gồm: ·         Đào tạo lớp nhận thức. ·         Diễn giải thuật ngữ và tiêu chuẩn ISO 9001:2008. ·         Đào tạo lớp xây dựng hệ thống tài liệu ISO 9001:2008. ·         Đào tạo lớp đánh giá chất lượng nội bộ. -      Sau các khóa đào tạo, các học viên sẽ có khả  năng xây dựng và quản lý hệ thống tài liệu-hồ sơ, xây dựng hệ thống văn bản, áp dụng hệ thống quản lý và trở thành các chuyên viên đánh giá nội bộ. -      Sau mỗi lớp học, chúng tôi sẽ tổ chức các buổi kiểm tra. 3. Chương trình tư vấn -      Chương trình tư vấn sẽ gồm nhiều bước, được thực hiện nhằm xây dựng và áp dụng hệ thống quản lý chất lượng theo tiêu chuẩn ISO 9001:2008 theo mô hình của Quý Công ty bao gồm: ·         Điều chỉnh các mô tả công việc theo cơ cấu tổ chức Quý Công ty. ·         Xác định phạm vi hệ thống quản lý chất lượng. ·         Xác định xây dựng và bổ sung cơ cấu tổ chức. ·         Xác định ma trận trách nhiệm của các bộ phận theo tiêu chuẩn ISO 9001:2008. ·         Thành lập ban chất lượng và xác định kế hoạch triển khai xây dựng tài liệu. ·         Xây dựng 06 quy trình cơ bản theo yêu cầu của tiêu chuẩn ISO 9001:2008. ·         Xây dựng các thủ tục tác nghiệp theo yêu cầu của hệ thống ·         Xây dựng các hướng dẫn công việc. ·         Xây dựng các quy định tác nghiệp. ·         Xây dựng chính sách chất lượng. ·         Xây dựng các mục tiêu chất lượng và kế hoạch hành động ·         Xây dựng sổ tay chất lượng. ·         Theo dõi và điều chỉnh áp dụng hệ thống. ·         Thực hiện đánh giá chất lượng nội bộ. ·         Hướng dẫn thực hiện các hành động khắc phục, phòng ngừa. ·         Họp xem xét lãnh đạo. ·         Hoàn chỉnh hệ thống tài liệu và ban hành áp dụng tổng thể. ·         Hỗ trợ đánh giá chứng nhận chính thức. -      Hướng dẫn thực hiện các hành động khắc phục, phòng ngừa sau đánh giá chính thức. -      Chương trình Tư Vấn Xây Dựng và Áp Dụng Hệ Thống Quản Lý Chất Lượng theo tiêu chuẩn ISO 9001:2008 sẽ được thực hiện bởi các chuyên viên có nhiều kinh nghiệm và được các tổ chức quốc tế công nhận. -      Thời gian cụ thể tiến hành tư vấn sẽ được thống nhất bằng văn bản giữa hai bên.   II - CÁC DỊCH VỤ HỖ TRỢ LIÊN QUAN ĐẾN CHƯƠNG TRÌNH ĐÀO TẠO &amp; TƯ VẤN -      Đăng ký tổ chức đánh giá chứng nhận. -      Hướng dẫn thực hiện các hành động khắc phục, phòng ngừa sau đánh giá chính thức. -      Giảm giá tái đào tạo/tái cấu trúc Hệ Thống Quản Lý Chất Lượng cho các khách hàng đã ký hợp đồng với Công ty TNHH Tư Vấn Quản Lý Lương. -      Giới thiệu những đối tác tiềm năng trong danh sách khách hàng của Công ty TNHH Tư Vấn Quản Lý Lương. -      Đảm bảo phương thức dịch vụ tư vấn - đào tạo và phương thức thanh toán linh hoạt, thuận lợi và dựa trên kế hoạch thuận tiện nhất cho Quý Công ty. '),
